" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Limbal signs in vernal keratoconjunctivitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 258px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the \"limbal\" form of vernal keratoconjunctivitis (VKC), the pathology centers around the limbus, which is the border between the cornea and conjunctiva. The abnormality consists of the formation of whitish aggregates of inflammatory cells at the border of the cornea.",
