"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?40/30/41443/abstract/3\">",
"      Safa AA, Valji K, Roberts AC, et al. Detection and treatment of dysfunctional hemodialysis access grafts: effect of a surveillance program on graft patency and the incidence of thrombosis. Radiology 1996; 199:653.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?40/30/41443/abstract/4\">",
"      Migliacci R, Selli ML, Falcinelli F, et al. Assessment of occlusion of the vascular access in patients on chronic hemodialysis: comparison of physical examination with continuous-wave Doppler ultrasound. STOP Investigators. Shunt Thrombotic Occlusion Prevention with Picotamide. Nephron 1999; 82:7.",
"     </a>",
"    </li>",
